package db.domain;import java.util.Arrays;import java.util.Date;public class LogsImpl implements Logs {	@Key	private int logId;	private String uname;	private Date createTime;	private int type;	private String log;	public LogsImpl() {	}	public LogsImpl(Logs c) {		this.logId = c.getLogId();		this.uname = c.getUname();		this.createTime = c.getCreateTime();		this.type = c.getType();		this.log = c.getLog();	}	@Override	public String tableName() {		return "logs";	}	public void setLogId(int logId) {		this.logId = logId;	}	public int getLogId() {		return this.logId;	}public void addLogId(int logId) {		this.logId += logId;}	public void setUname(String uname) {		this.uname = uname;	}	public String getUname() {		return this.uname;	}public void addUname(String uname) {		this.uname += uname;}	public void setCreateTime(Date createTime) {		this.createTime = createTime;	}	public Date getCreateTime() {		return this.createTime;	}	public void setType(int type) {		this.type = type;	}	public int getType() {		return this.type;	}public void addType(int type) {		this.type += type;}	public void setLog(String log) {		this.log = log;	}	public String getLog() {		return this.log;	}public void addLog(String log) {		this.log += log;}}